import numpy as np

def calibrate_threshold(test_logits, train_logits, test_threshold):
    """
    根據 testing set 的 threshold 和 logit 分佈，
    在 training set 上找到對應 percentile 的 threshold。

    Args:
        test_logits (list or np.ndarray): testing set 的 logit max 分佈
        train_logits (list or np.ndarray): training set 的 logit max 分佈
        test_threshold (float): testing set 上的 threshold

    Returns:
        float: training set 上的 calibrated threshold
    """
    test_logits = np.array(test_logits)
    train_logits = np.array(train_logits)

    # 1. 計算 testing set 上 threshold 對應的 percentile
    percentile = (test_logits <= test_threshold).sum() / len(test_logits)

    # 2. 在 training set 上找到相同 percentile 對應的 threshold
    calibrated_threshold = np.quantile(train_logits, percentile)

    return calibrated_threshold



